import {NavLink} from "react-router-dom"; 

import '../styles/Nav.css';

const Nav = (props) => {
    return (
        <div className="nav-container">
            <ul className="header-nav">
                <li>
                    <NavLink className="nav-link" style={{color: props.color}} to="/">About</NavLink>
                </li>
                <li>
                    <NavLink className="nav-link" style={{color: props.color}} to="/">Workshops</NavLink>
                </li>
                <li>
                    <NavLink className="nav-link" style={{color: props.color}} to="/">Register</NavLink>
                </li>
            </ul>
        </div>    
    )
}

export default Nav;
